import './Upload.css';
import React, {
  useState,
  useCallback,
  useEffect,
  ChangeEvent,
  useRef
} from 'react';


function Upload() {

  return (
    <div className="Upload">
       <input type= "file" id="fileUpload" multiple={false} />
       <label
        className={isDragging ? "DragDrop-File-Dragging" : "DragDrop-File"}
        htmlFor="fileUpload"
        ref={dragRef}>
        <div>Upload Your Video</div>
      </label>
    </div>
  );
}

export default Upload;
